import React from "react";
import { FaBars, FaTh, FaUserAlt } from "react-icons/fa";

export default function Sidebar() {
const menuItem=[
    {
        path:"/",
        name:"Dashboard",
        icon:<FaTh/>
    },
    {
        path:"/about",
        name:"About",
        icon:<FaUserAlt/>
    },
    {
        path:"/",
        name:"Contact",
        icon:<FaPhoneAlt/>
    }
]

    return <>
    <div className="container">
        <div className="sidebar">
            <div className="top_section">
                <h1>Logo</h1>
                <div className="bars">
                    <FaBars/>
                </div>
            </div>
        </div>
    </div>

    </>
}
